from typing import List

class Solution:
    def findMaxAverage(self, nums: List[int], k: int) -> float:
        ma = -2147483648
        for i in range(len(nums)):
            n = nums[i:i+k]
            if len(n) == k:
                p = sum(n) / k
                ma = max(p, ma)
        return ma


